import React from 'react';
import '../styles/components/layout.css';
import '../styles/components/base.css';
import '../styles/pages/general-search.css';

const GeneralSearchPage = () => {
    return (
        <div className="general-search-page">

            <div className="search-bar">
                <input type="text" placeholder="Tìm kiếm ngành hoặc trường..." />
                <button>Tìm kiếm</button>
            </div>

            <main className="content">
                <section className="results">
                    <h2>Kết quả tìm kiếm cho:</h2>
                    <div className="result-grid">
                        <div className="result-item">Kết quả 1</div>
                        <div className="result-item">Kết quả 2</div>
                        <div className="result-item">Kết quả 3</div>
                        <div className="result-item">Kết quả 4</div>
                        <div className="result-item">Kết quả 5</div>
                        <div className="result-item">Kết quả 6</div>
                        <div className="result-item">Kết quả 7</div>
                        <div className="result-item">Kết quả 8</div>
                        <div className="result-item">Kết quả 9</div>
                    </div>
                </section>
            </main>

        </div>
    );
};

export default GeneralSearchPage;
